/// <summary>
/// Добавить новые издания
/// </summary>
/// <param name="periodicity">Справочное поле "Периодичность"</param>
public virtual void AddNewEditions(Guid periodicity)
{
	var recordsToCreate = Get<int>("InsertRecordCount");
	var editionsStatus = Get<Guid>("EditionsStatus");
	var editionsId = Get<Guid>("SelectedEditionsId");
	var startDate = DateTime.Now;

	for(int i = 0; i< recordsToCreate; i++)
	{
		SaveNewEdition(editionsId, startDate, editionsStatus);
		GetNextDatePeriod(periodicity, ref startDate);
	}
}

/// <summary>
/// Сохранить новое издание
/// </summary>
/// <param name="editionsId">Id издания</param>
/// <param name="startDate">Дата начала</param>
/// <param name="tourState">Справочное поле "Состояние издания"</param>
public virtual void SaveNewEdition(Guid editionsId, DateTime startDate, Guid editionsStatus)
{
	var newEditionsScheme = UserConnection.EntitySchemaManager.GetInstanceByName("UsrPublicationDetail");
	var newEditions = newEditionsScheme.CreateEntity(UserConnection);

    newEditions.SetColumnValue("Id", Guid.NewGuid());
    newEditions.SetColumnValue("UsrCirculation", 10);
    newEditions.SetColumnValue("UsrReleaseStatusId", editionsStatus);
    newEditions.SetColumnValue("UsrDate", startDate);
    newEditions.SetColumnValue("UsrPeriodicalEditionsId", editionsId);
    newEditions.Save();	
}

/// <summary>
/// Получить следующую дату начала издания
/// </summary>
/// <param name="periodicity">Справочное поле "Периодичность"</param>
/// <param name="date">Дата начала</param>
public virtual void GetNextDatePeriod(Guid periodicity, ref DateTime date)
{
   if (periodicity == UsrPublishingOfficeConstants.PublishingInterval.Everyday)
   {
      date = date.AddDays(1);
   }
   else if (periodicity == UsrPublishingOfficeConstants.PublishingInterval.Everyweek)
   {
      date = date.AddDays(7);
   }
   else if (periodicity == UsrPublishingOfficeConstants.PublishingInterval.EveryMonth)
   {
       date = date.AddMonths(1);
   }	
}
